!function(r){r.stringToBytes=function(r){function n(r){for(var n=[],t=0;t<r.length;t++){var u=r.charCodeAt(t);u<128?n.push(u):u<2048?n.push(192|u>>6,128|63&u):u<55296||u>=57344?n.push(224|u>>12,128|u>>6&63,128|63&u):(t++,u=65536+((1023&u)<<10|1023&r.charCodeAt(t)),n.push(240|u>>18,128|u>>12&63,128|u>>6&63,128|63&u))}return n}return n(r)}}(qrcode);